void convertMarkdownToHtml(std::string &input) {

    // Trenne innholdet i input i to strings: innholdet som skal omformert, og et tomt string som skal benyttes til å lagre resultatet.
    std::string inputText = input;
    std::string outputText;

    // Fastholder innholdet i input som formatert med markdown.
    std::regex markdownRegex(".*?```(.*?)```");
    std::smatch match;
    std::regex_search(inputText, match, markdownRegex);
    if (match.size() == 0) {
        // Innholdet i input er ikke formatert med markdown. returner resultatet som er det samme som input.
        outputText = inputText;
    } else {
        // Innholdet i input er formatert med markdown.
        // Gjør det første innholdet i match til et tomt string. Denne innsatsen vil brukes for å lagre resultatet når det er utformet. 
        outputText = ""; 

        // Kopiere første innsatsen fra match for å sette resultatet igjen på nytt. Denne innsatsen er det tomme stringet fra over først. 
        outputText = match[1];
        // Gjør alle innsatser etter matchen til et tomt string.  Denne innsatsen er det tomme stringet fra over først. 
        for (int i = 2; i < match.size(); ++i) {  
            outputText += "\\n";   // Lagre linjene mellom de ulike innhaltene.  Enkelte linjer kan også bli gjengitt på andre måte, hvis dette er ønsket.    
            outputText += match[i];   // Kopiere den neste innsatsen fra match for å sette resultatet igjen på nytt. Denne innsatsen er den samme innsatsen som ble kopiert tidligere, men den er nå et tomt string.        
